"""
无重复字符的最长子串
"""
import time


# 暴力解法
class Solution:
    def lengthOfLongestSubstring(slef, s: str) -> int:
        # 如果字符串为空，返回0
        if not s: return 0
        # 初始化新的字符串
        res_temp = ""
        # 返回入参长度
        length = len(s)
        # 取切片的第一个坐标
        for i in range(length):
            # 取切片的第二个坐标
            for j in range(i + 1, length + 1):
                # 取出所有子串
                t = s[i:j]
                if len(t) == len(set(t)) and len(t) > len(res_temp):
                    res_temp = t
        print(len(res_temp))


